goog.provide("goog.locale.TimeZoneListTest");goog.setTestOnly("goog.locale.TimeZoneListTest");goog.require("goog.locale");goog.require("goog.locale.TimeZoneList");goog.require("goog.testing.jsunit");function setUpPage(){var TimeZoneSelectedIds__FR=["Etc/GMT+12","Pacific/Midway","America/Adak","Pacific/Honolulu"];goog.locale.registerTimeZoneSelectedIds(TimeZoneSelectedIds__FR,"FR");var TimeZoneSelectedShortNames__de_DE={"Etc/GMT+12":"GMT-12:00","Etc/GMT+11":"GMT-11:00","Pacific/Pago_Pago":"Amerikanisch-Samoa","Pacific/Midway":"Midway (Amerikanisch-Ozeanien)","Pacific/Honolulu":"Honolulu (Vereinigte Staaten)","Etc/GMT+10":"GMT-10:00","America/Adak":"Adak (Vereinigte Staaten)"};goog.locale.registerTimeZoneSelectedShortNames(TimeZoneSelectedShortNames__de_DE,"de_DE");var TimeZoneSelectedLongNames__de_DE={"Etc/GMT+12":"GMT-12:00","Etc/GMT+11":"GMT-11:00","Pacific/Pago_Pago":"GMT-11:00 Amerikanisch-Samoa","Pacific/Midway":"GMT-11:00 Midway (Amerikanisch-Ozeanien)","Pacific/Honolulu":"GMT-10:00 Honolulu (Vereinigte Staaten)","Etc/GMT+10":"GMT-10:00","America/Adak":"GMT-10:00 Adak (Vereinigte Staaten)"};goog.locale.registerTimeZoneSelectedLongNames(TimeZoneSelectedLongNames__de_DE,"de_DE");var TimeZoneSelectedIds__en=["Etc/GMT+12","Pacific/Midway","America/Adak","Pacific/Honolulu"];goog.locale.registerTimeZoneSelectedIds(TimeZoneSelectedIds__en,"en");var TimeZoneSelectedIds__DE=["Etc/GMT+12","Pacific/Midway","America/Adak","Pacific/Honolulu"];goog.locale.registerTimeZoneSelectedIds(TimeZoneSelectedIds__DE,"DE");var TimeZoneAllLongNames__de_DE=[{id:"Etc/GMT+12",name:"GMT-12:00"},{id:"Pacific/Apia",name:"GMT-11:00 Samoa"},{id:"Pacific/Midway",name:"GMT-11:00 Midway (Amerikanisch-Ozeanien)"},{id:"Pacific/Niue",name:"GMT-11:00 Niue"},{id:"Pacific/Pago_Pago",name:"GMT-11:00 Amerikanisch-Samoa"},{id:"Etc/GMT+11",name:"GMT-11:00"},{id:"America/Adak",name:"GMT-10:00 Adak (Vereinigte Staaten)"},{id:"Pacific/Fakaofo",name:"GMT-10:00 Tokelau"}];goog.locale.registerTimeZoneAllLongNames(TimeZoneAllLongNames__de_DE,"de_DE");goog.locale.setLocale("de_DE")}function testTimeZoneSelectedShortNames(){var result=goog.locale.getTimeZoneSelectedShortNames("FR");assertEquals("Honolulu (Vereinigte Staaten)",result[3].name)}function testTimeZoneSelectedLongNames(){var result=goog.locale.getTimeZoneSelectedLongNames("en");assertEquals("GMT-11:00 Midway (Amerikanisch-Ozeanien)",result[1].name);var result=goog.locale.getTimeZoneSelectedLongNames();assertEquals("GMT-10:00 Adak (Vereinigte Staaten)",result[2].name)}function testTimeZoneAllLongNames(){var result=goog.locale.getTimeZoneAllLongNames();assertEquals("GMT-10:00 Tokelau",result[7].name)}